import './App.css';
import Card from './cards/card.js'

function App() {
  <link href="https://fonts.googleapis.com/css?family=Lobster" rel="stylesheet" type="text/css"></link>

  return (
    <div className="App">

      <h1>Harry Potter Test</h1>
      <article>
        <Card>1</Card>
        <Card>2</Card>
        <Card>3</Card>
        <Card>4</Card>
        <Card>5</Card>
        <Card>6</Card>
        <Card>7</Card>
        <Card>8</Card>
      </article>



    </div>
  );
}

export default App;
